import React from 'react';
import Webcam from "react-webcam";

function Camera () {

    const videoConstraints = {
        facingMode: 'user'
    };

    const styles = {
        margin: '0 auto',
        display: 'block'
    };
    

    return (
            <Webcam
                audio={false}
                style={styles}
                videoConstraints={videoConstraints}
            />
    );
}

export default Camera;
